import React from 'react'

function Cards(pokemons) {
  return (
    <div >
      {/* {console.log("pokemons in cards", pokemons)} */}
       {pokemons.pokemons.map(function (pokemon){
      return (<div className='eachcards'>
        <img className='pokeimage' src={pokemon.image}></img>
        <h3>{pokemon.name[0].toUpperCase()+ pokemon.name.slice(1)}</h3>
        <h4>{pokemon.type}</h4>
      </div>)}
      )
      }


    </div>
  )
}

export default Cards
